/*
 * @Author: hhhhhq
 * @Date: 2020-06-27 11:23:25
 * @LastEditors: hhhhhq
 * @LastEditTime: 2020-06-27 21:20:54
 * @Description: file content
 */ 
import React from 'react'
import classNames from 'classnames'
import Moment from 'react-moment'
import Link from 'next/link'

type Launch = {
  flight_number: string;
  launch_date_local: string;
  launch_success: boolean;
  mission_name: string
}

type Props = {
  launch: Launch
}
const LaunchItem: React.FC<Props> = ({
  launch: { flight_number, launch_date_local, launch_success, mission_name }
 }) => {
  return (
    <div className="card card-body mb-3">
      <div className="row">
        <div className="col-md-9">
          <h4>Mission: <span className={classNames({
            'text-success': launch_success,
            'text-danger': !launch_success
          })}>{ mission_name }</span></h4>
          <p>Date: <Moment format="YYYY-MM-DD HH:mm">{ launch_date_local }</Moment></p>
        </div>
        <div className="col-md-3">
          <Link href={`/launch/[flight_number]`} as={`/launch/${flight_number}`}>
            <a className="btn btn-secondary">Launch Details</a>  
          </Link>
        </div>
      </div>
    </div>
  )
}

export default LaunchItem
